"use client"
import React, { useState, useRef } from "react";

const BlogEditor = () => {
  const [text, setText] = useState(""); // State to store the text
  const textAreaRef = useRef(null); // Ref for the textarea

  // Function to handle emoji insertion
  const insertEmoji = (emoji) => {
    const textarea = textAreaRef.current;
    if (!textarea) return;

    const start = textarea.selectionStart;
    const end = textarea.selectionEnd;
    const newText = text.substring(0, start) + emoji + text.substring(end);

    setText(newText);

    // Restore cursor position after inserting emoji
    setTimeout(() => {
      textarea.selectionStart = textarea.selectionEnd = start + emoji.length;
      textarea.focus();
    }, 0);

  };

  return (
<article className="max-w-full px-4 py-8">
<div className="w-full mx-0 text-center"><div className="rounded-md overflow-hidden rounded-none"><img src="data:image/avif;base64," alt="" className="max-h-[220px] w-full object-cover object-[50.74962513595935%_4.545454545454547%]" /></div></div>
</article>

  )}
  export default BlogEditor;